import React from 'react';
import './App.css';
import Navigation from './Navigation';
import { NavLink, Nav, Navbar, Button, Form, FormControl } from "react-bootstrap";
import { Link, Route, Router, BrowserRouter } from "react-router-dom";


function About() {
  return (
    <div>
      
      <Navbar className="color-nav" variant="light">
          <Navbar.Brand href="home">NatureKnitter</Navbar.Brand>
          <Nav>
            <Button variant="light">Products</Button>
          </Nav>
          <div class="divider"/>
          
          <Nav>
              <Button variant="light">
               <Link to="/about">
               About
               </Link>
              </Button>
          </Nav>
        </Navbar>

      
    <h1>this is the about page</h1>        
    </div>
  );
}

export default About;
